const config = {
	useTabs: true,
	singleQuote: true,
	trailingComma: 'none',
	printWidth: 100,
	plugins: ['prettier-plugin-svelte'],
	overrides: [{ files: '*.svelte', options: { parser: 'svelte' } }],
	endOfLine: 'auto'
};

export default config;

[workspace]
members = [
    "crates/gitbutler-tauri",
    "crates/gitbutler-git",
    "crates/gitbutler-watcher",
