]
resolver = "2"

[workspace.dependencies]
bstr = "1.11.1"
# Add the `tracing` or `tracing-detail` features to see more of gitoxide in the logs. Useful to see which programs it invokes.
gix = { git = "https://github.com/GitoxideLabs/gitoxide", rev = "a22f13bec0cdd580ee92390a98d5d522eb29978d", default-features = false, features = [] }
git2 = { version = "0.20.0", features = [
    "vendored-openssl",
    "vendored-libgit2",
] }
uuid = { version = "1.11.0", features = ["v4", "serde"] }
serde = { version = "1.0", features = ["derive"] }
thiserror = "2.0.9"
tokio = { version = "1.42.0", default-features = false }
keyring = { version = "3.6.1", features = ["apple-native", "windows-native", "linux-native", "crypto-rust"] }
anyhow = "1.0.95"
parking_lot = "0.12.3"
futures = "0.3.31"
toml = "0.8.13"
tracing = "0.1.41"
