{
  inputs = {
    nixpkgs.url = "github:nixos/nixpkgs/nixos-24.05";
    unstablePkgs.url = "github:nixos/nixpkgs/nixpkgs-unstable";
    flake-utils.url = "github:numtide/flake-utils";
    nix-playwright-browsers.url = "github:voidus/nix-playwright-browsers";
    rust-overlay = {
      url = "github:oxalica/rust-overlay";
      inputs = {
        nixpkgs.follows = "unstablePkgs";
      };
    };
  };
  outputs = { self, unstablePkgs, nixpkgs, flake-utils, rust-overlay, nix-playwright-browsers }:
    flake-utils.lib.eachDefaultSystem
      (system:
        let
          overlays = [ (import rust-overlay) ];
          unstable = import unstablePkgs {
            inherit system overlays;
          };
          pkgs = import nixpkgs {
            system = system;
            overlays = [ nix-playwright-browsers.overlays.${system}.default];
          };

          rustToolchain = unstable.pkgsBuildHost.rust-bin.fromRustupToolchainFile ./rust-toolchain.toml;

          common = with pkgs; [
            gtk3
            glib
            glib-networking
            dbus
            openssl_3
            librsvg
            gettext
            libiconv
            libsoup
            libsoup_3
            webkitgtk
            webkitgtk_4_1
            nodejs_20
            corepack_20
            pkgs.playwright-browsers_v1_47_0
          ];

          # runtime Deps
          libraries = with pkgs; [
            cairo
            pango
            harfbuzz
            gdk-pixbuf
          ] ++ common;

          # compile-time deps
          packages = with pkgs; [
            curl
            wget
            pkg-config
            rustToolchain
          ] ++ common;
        in
        {
          devShells.default = pkgs.mkShell {
            nativeBuildInputs = packages;
            buildInputs = libraries;
            shellHook = ''
              LD_LIBRARY_PATH=${pkgs.lib.makeLibraryPath libraries}:$LD_LIBRARY_PATH
              XDG_DATA_DIRS=${pkgs.gsettings-desktop-schemas}/share/gsettings-schemas/${pkgs.gsettings-desktop-schemas.name}:${pkgs.gtk3}/share/gsettings-schemas/${pkgs.gtk3.name}:$XDG_DATA_DIRS
              GIO_MODULE_DIR=${pkgs.glib-networking.out}/lib/gio/modules/
              GIO_EXTRA_MODULES=${pkgs.glib-networking.out}/lib/gio/modules/

              PLAYWRIGHT_BROWSERS_PATH=${pkgs.playwright-browsers_v1_47_0}
              PLAYWRIGHT_SKIP_BROWSER_DOWNLOAD=1
              PLAYWRIGHT_SKIP_VALIDATE_HOST_REQUIREMENTS=true
            '';
          };
        }
      );
}

{
	"$schema": "https://turborepo.org/schema.json",
	"tasks": {
		"package": {
			"dependsOn": ["^package"],
			"outputs": ["dist/**"]
		},
		"build": {
			"dependsOn": ["package"],
			"passThroughEnv": ["SENTRY_AUTH_TOKEN", "GITHUB_TOKEN"],
			"env": ["SENTRY_RELEASE"],
			"outputs": [
				".svelte-kit/**",
				"!.sveltekit/types",
				"!.sveltekit/*.d.ts",
				"dist/**",
				".vercel/**"
			]
		},
		"dev": {
			"dependsOn": ["package"],
			"cache": false,
			"persistent": true
		},
		"check": {
			"dependsOn": ["package"]
		},
		"playwright:install": {},
		"test": {
			"dependsOn": ["package", "playwright:install"]
		},
		"test:e2e:web": {
			"env": ["PLAYWRIGHT_BROWSERS_PATH"],
			"dependsOn": ["package"]
		},
		"//#globallint": {
			"dependsOn": ["@gitbutler/ui#package", "@gitbutler/shared#package"]
		}
	}
}
